        private static string GetFaceReconitionResult(string img)
        {
            StringBuilder sb = new StringBuilder();

            try
            {
                FRJsonResolve.BaseJR jr = FaceReconitionJsonResolve.FR_DetectResult(img, "BASE64");

                if (jr.error_conde != 0)
                {
                    jr.error_msg = GetFRError_Code(jr.error_conde);
                }

                sb.Append(jr.ToString());
            }
            catch (System.Net.WebException ex)
            {
                sb.Append("网络异常!请检查您的电脑是否连接上外网!");
            }
            
            return sb.ToString();
        }

        private static string GetFRError_Code(int i)
        {
            FRJsonResolve.FRError_Code error_code = (FRJsonResolve.FRError_Code)Enum.Parse(typeof(FRJsonResolve.FRError_Code), i.ToString());
            return error_code.ToString();
        }
